import styled from 'styled-components'
import React from 'react'

const Login = (props) => {
    return (
        <Container>
            <Nav>
                <a href="/">
                    <img src="images/login-logo.svg" alt=""/>
                </a>

                <div>
                  <Join>Join Now</Join>
                </div>
            </Nav>
        </Container>
    );
};

const Container = styled.div`
  padding: 0px;
`;

const Nav = styled.nav`
    max-width: 1128px;
    margin: auto;
    padding: 12px 0 16px;
    display: flex;
    align-items: center;
    position: relative;
    justify-content: space-between;
    flex-wrap: nowrap;

    & > a {
        width:135px;
        height: 34px;
        @media (max-width: 768px){
            padding: 0 5px;

        }
        
    }
`;

const Join = styled.a`
    
`;
export default Login;
